import React from 'react';
import { Typography, Card, CardContent, Box } from '@mui/material';

function Projects() {
  const projectList = [
    { title: "Portfolio Website", description: "Built with React and GSAP animations." },
    { title: "E-commerce App", description: "Fullstack app with Node.js backend." },
  ];

  return (
    <div style={{ marginTop: '2rem' }}>
      <Typography variant="h3" gutterBottom align="center">Projects</Typography>
      {projectList.map((project, index) => (
        <Card key={index} sx={{ marginBottom: 2 }}>
          <CardContent>
            <Box sx={{
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'center',
              alignItems: 'center',
              textAlign: 'center',
            }}>
              <Typography variant="h5" sx={{ marginBottom: 1 }}>{project.title}</Typography>
              <Typography>{project.description}</Typography>
            </Box>
          </CardContent>
        </Card>
      ))}
    </div>
  );
}

export default Projects;
